// ListagensTabs.tsx
import React from "react";
import { Tab, Tabs } from "react-bootstrap";  // Supondo o uso do react-bootstrap
import ClienteConsumoValor from "./clienteConsumoValor";
import ClienteMaiorQtd from "./clienteMaiorQuantidade";
import ClienteMenorConsumo from "./clienteMenorConsumo";
import ProdutoServicoConsumo from "./produtoServicoConsumo";
import ConsumoGenero from "./consumoGenero";

const ListagensTabs = () => {
    return (
        <Tabs defaultActiveKey="cliente-consumo-valor" id="listagens-tabs" className="mb-3">
            {/* Aba Cliente Consumo Valor */}
            <Tab eventKey="cliente-consumo-valor" title="Cliente Consumo Valor">
                <ClienteConsumoValor />
            </Tab>
            {/* Aba Cliente Maior Quantidade */}
            <Tab eventKey="cliente-maior-qtd" title="Cliente Maior Quantidade">
                <ClienteMaiorQtd />
            </Tab>
            {/* Aba Cliente Menor Consumo */}
            <Tab eventKey="cliente-menor-consumo" title="Cliente Menor Consumo">
                <ClienteMenorConsumo />
            </Tab>
            {/* Aba Produto/Serviço Consumo */}
            <Tab eventKey="produto-servico-consumo" title="Produto/Serviço Consumo">
                <ProdutoServicoConsumo />
            </Tab>
            {/* Aba Consumo por Gênero */}
            <Tab eventKey="consumo-genero" title="Consumo por Gênero">
                <ConsumoGenero />
            </Tab>
        </Tabs>
    );
};

export default ListagensTabs;
